import React, { useEffect, Fragment } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
// import JobItem from './jobItem';
import { getAllJobs } from '../../actions/jobs';
import Spinner from '../layout/Spinner';


const AlljobsList = ({
    getAllJobs,
    jobItem: {jobItem, loading}
}) => {
    useEffect(() => {
     getAllJobs();   
    }, [getAllJobs]);
    return loading && jobItem === null ? (
        <Spinner />
    ): (
        <Fragment>
        <h1 className='large text-primary'>Dashboard</h1>
        <p className='lead'>
          <i className='fas fa-user' /> Welcome to swipe smart
        </p>
        {
            jobItem !== null ? (
                <Fragment>not null</Fragment>
            ):(
                <Fragment>null</Fragment>
            )
        }
        </Fragment>
    );
};

AlljobsList.propTypes = {
    getAllJobs: PropTypes.func.isRequired,
    jobItem: PropTypes.object.isRequired,
};

const mapStateToProps = state => ({
    jobItem: state.jobItem
});

export default connect(mapStateToProps, { getAllJobs })(AlljobsList);
